(21, 18, 4, '<p>Setup load balancer for Backoffice systems Environment</p>', '2022-10-03 21:48:27', '2022-10-03 21:48:27', NULL, NULL, NULL, NULL),
(22, 18, 14, '<p class=\"ql-align-center\"><strong><u>SITUATIONAL REPORT AND RECOMMENDATIONS FOR RESOLVING AND IMPROVING ELIS PLATOFRM</u></strong></p><p class=\"ql-align-right\">&nbsp;</p><p class=\"ql-align-justify\">The following is a summarised report detailing activities, problem analysis and recommendations.</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Meeting:</strong></p><p class=\"ql-align-justify\">Following the receipt of this ticket, a meeting to assess and understand the nature and causes of the problem was organised between LC and Casantey.</p><p class=\"ql-align-justify\">Meeting took place at the PVLMD conference hall of the Lands Commission on Wednesday, October 5th, 2022 at 9:00AM GMT.</p><p class=\"ql-align-justify\">Key meeting participants were Dr, Ben Quaye, Mr Kwabena Boafo, Mr Robert Aryeh, Mr Jude Yamoah, Mr John Assiamah (joined virtually), Mr Daniel Marfo (from Casantey) and host of officers from the software team.</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Introduction:</strong></p><p class=\"ql-align-justify\">The meeting kicked off with an introduction statement from Mr Kwabena Boafo. He outlined the reasons for the meeting. Key amongst the outlined items were to find out the cause of the slowness of the ELIS software, identify immediate solutions, as well as potential medium to long term solutions.</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Problem Identification:</strong></p><p class=\"ql-align-justify\">After the introduction, Mr Jude Yamoah was asked to describe the problem and to also explain his proposed solution. In his address, he explained the behaviour of the system as being slow at certain hours during the day, usually during the peek hours. He did indicate that performance monitoring data showed CPU spikes for certain types of requests. These spikes does causes the entire system to be slow and unresponsive, making it difficult for users to access and use the system. He also mentioned the fact that a number of Joins in the queries could be a reason for the cpu spikes.</p><p class=\"ql-align-justify\">He further gave a description of the current system architecture.</p><p class=\"ql-align-justify\"><strong>System Architecture and Infrastructure:</strong></p><p class=\"ql-align-justify\">The ELIS currently runs of 2 servers. An Application server which hosts the front end and web services, and a DB server which hosts a Postgres database. The DB server had 4 vCPUs, 32 GB of RAM and 1.5 TB of storage space.</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Proposed Solutions:</strong></p><p class=\"ql-align-justify\">Mr Yamoah\'s proposed solution was to create&nbsp;read-replicas of the database. By so doing, read requests get forwarded only the read-replicas whiles the master database serves write requests.</p><p class=\"ql-align-justify\">He also proposed the use of load balancers to balance the load amongst the database instances.</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Alternative proposal:</strong></p><p class=\"ql-align-justify\">Mr Daniel Marfo proposed an alternative solution to address the core challenges with the application.</p><p class=\"ql-align-justify\">The proposal is to take a look at the database structure and optimise the queries. It was suggested that the software team looks at the multiple join statements and optimise the queries and the database as a whole, before any scaling activity is performed. It is suggested that, without properly designing the database (and the system), replication of the database will only mean a replication of the problems.</p><p class=\"ql-align-justify\">Further, it is proposed that the team look into decoupling the system resulting in an event-driven microservice architecture. It is also further suggested that consideration is given to implementation of caching mechanisms.</p><p class=\"ql-align-justify\">At the tail end of the meeting, Mr Marfo advised that, as interim measure, the vCPUs be increased from 4 to 8. And an autoscaling script be put in place to add more vCPUs when the load hits a certain threshold (eg. above 70%).</p><p class=\"ql-align-justify\">Mr John Assiamah, agreed with Mr Marfo\'s proposal of looking into optimising the queries and the database before creating the read-replicas.</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Agreed Steps:</strong></p><p class=\"ql-align-justify\">The team agreed to undertake the following actions in the immediate, short, medium&nbsp;and long term:</p><p class=\"ql-align-justify\">1.&nbsp;&nbsp;&nbsp;Increase the vCPUs from 4 to 8. To be done by the LC IT team (Immediate term.).</p><p class=\"ql-align-justify\">2.&nbsp;&nbsp;&nbsp;Implement Auto scaling script to automatically detect cpu spikes and scale in and out. To be done by IT team (Short term)</p><p class=\"ql-align-justify\">3.&nbsp;&nbsp;&nbsp;Optimise queries. To be done by Jude (Short term)</p><p class=\"ql-align-justify\">4.&nbsp;&nbsp;&nbsp;Decoupling services. (Medium to Long term)</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Conclusions and Recommendations:</strong></p><p class=\"ql-align-justify\">Our Casantey independent observation from the information provided are as follows:</p><p class=\"ql-align-justify\">1.&nbsp;&nbsp;&nbsp;The ELIS software has evolved in several shapes and forms over the years</p><p class=\"ql-align-justify\">2.&nbsp;&nbsp;&nbsp;The system architecture is monolithic</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">Our Casantey technical recommendation is as follows:</p><p class=\"ql-align-justify\">1.&nbsp;&nbsp;&nbsp;Undertake a system redesign. In the process, key non-functional requirements such as performance, load, latency, etc will be addressed properly</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">2.&nbsp;&nbsp;&nbsp;Adopt a microservice architecture. This will help decouple services, provides a more resilient and highly scalable system. Decoupling the system into smaller independent units will make it easier to detect and address faults. One of the important advantages of such an architect is fault isolation. One service down may not cause all other parts of the system to shut down.</p><p><br></p>', '2022-10-06 19:27:08', '2022-10-06 19:27:08', NULL, NULL, NULL, NULL),
