(137, 100, 45, '<p>We need these columns added to the bills page</p><p>Bill id</p><p>Valuation number</p><p>Owners\' names (Valuation list) - display LVD names until it is added by the owner</p><p>Property Use Code</p><p>Area zone</p><p>Rateable value</p><p>Rate impost</p><p>Amount payable</p><p>Arrears&nbsp;</p><p>Outstanding amount</p><p>Actions button</p>', '2023-03-23 09:46:45', '2023-03-23 09:46:45', NULL, NULL, NULL, NULL),
(138, 101, 45, '<p>Adding the Marina Mall (an unvalued property) on production displays an error: Could not get property value. Please see attached</p>', '2023-03-23 15:30:16', '2023-03-23 15:30:16', NULL, NULL, NULL, NULL),
(139, 101, 45, '<p>Account details</p><p>C0005662346</p><p>Marina Mall building</p>', '2023-03-23 15:31:34', '2023-03-23 15:31:34', NULL, NULL, NULL, NULL),
(140, 102, 45, '<p>This user got logged out of their account and tried logging in and got an error saying phone number does not exist (Production)</p><p>Ikebet shining star hotel</p><p>0547229932</p><p>C0019140886</p>', '2023-03-23 15:33:30', '2023-03-23 15:33:30', NULL, NULL, NULL, NULL),
(141, 103, 45, '<p>Adding of property on production displays an error: Property could not be added</p><p>Organisation</p><p>Tin number:&nbsp;P0016330714</p><p>Phone number 0233271484</p><p>Ghana Post GPS GZ-005-0536</p><p>Account Name&nbsp;Yaw Twumasi</p>', '2023-03-23 15:35:29', '2023-03-23 15:35:29', NULL, NULL, NULL, NULL),
(142, 104, 45, '<p>Creating an organisation account on staging does not proceed after entering all account details.</p><p>Find account details below:</p><p>Business name Divine Pure water</p><p>Tin P0023151781</p><p>Name Emmanuel Somiah</p><p>Phone number 0553858458</p>', '2023-03-23 19:46:31', '2023-03-23 19:46:31', NULL, NULL, NULL, NULL),
(143, 105, 35, '<p>At the last pyhcial meeting on the migration of ELIS to the Cloud, it was agreed as follows</p><ol><li>Casantey to provide detail protocol on dealing with issues regarding ELIS</li><li>Casantey (Danny_) to provide estimated timelines o migrating the Map daa o he cloud</li><li>Acion plan o oin Live on the cloud</li></ol><p>Please provide urgent  update!!</p>', '2023-03-24 11:51:53', '2023-03-24 11:51:53', NULL, NULL, NULL, NULL),
(144, 105, 4, '<p>Acknowledged. Will revert anon</p>', '2023-03-24 12:00:23', '2023-03-24 12:00:23', NULL, NULL, NULL, NULL),
(145, 106, 35, '<p>We urgenly need logs regaring  <strong>P7546 </strong>to facilitate ongoing investigations</p>', '2023-03-24 12:22:47', '2023-03-24 12:22:47', NULL, NULL, NULL, NULL),
(146, 107, 35, '<p>Payment made but cannot proceed to acknowledge.</p><p>Job is not in the \"Uncompleted Request\" to enable client continue</p>', '2023-03-24 12:36:15', '2023-03-24 12:36:15', NULL, NULL, NULL, NULL),
(147, 108, 36, '<p>Attached are issues emanating from ELIS which need to be looked into.</p>', '2023-03-24 15:26:51', '2023-03-24 15:26:51', NULL, NULL, NULL, NULL),
(148, 109, 45, '<p>The payment gateway on a production account was not opening. It threw an error code 500</p>', '2023-03-26 08:30:29', '2023-03-26 08:30:29', NULL, NULL, NULL, NULL),
(149, 96, 4, '<p>Please see attached the draft document for discussion. Kind regards Christian</p>', '2023-03-26 10:57:28', '2023-03-26 10:57:28', NULL, NULL, NULL, NULL),
(150, 110, 36, '<p>Payments for Plan approval have been made since 22/3/2023 and deductions have been made. Receipts have been attached for reference. Up until now, the application cannot be acknowledged on ELIS. The feedback that pops up reads \'Bill has not been paid so it cannot be acknowledged. Urgent attention is therefore being sought, please.</p>', '2023-03-27 13:39:40', '2023-03-27 13:39:40', NULL, NULL, NULL, NULL),
(151, 111, 44, '<p>RGD have now installed an adequate UPS so the ECMS servers have to be restarted as a matter of urgency</p>', '2023-03-28 16:56:08', '2023-03-28 16:56:08', NULL, NULL, NULL, NULL),
(152, 112, 45, '<p>A property that is valued is asking for Floor type, door type, etc. </p>', '2023-03-29 14:27:31', '2023-03-29 14:27:31', NULL, NULL, NULL, NULL),
(153, 113, 45, '<p>\"Our service responded with an error\" error message displayed after filling provisional valuation form</p>', '2023-03-29 14:29:37', '2023-03-29 14:29:37', NULL, NULL, NULL, NULL),
(154, 114, 36, '<p>I suggest that a section on the web portal be created for applicants to make complaints on the web portal rather than them making it to Lands Commission for LC to resubmit the complaints to your outfit. I hope this suggestion will you find you well.</p>', '2023-03-31 08:04:28', '2023-03-31 08:04:28', NULL, NULL, NULL, NULL),
(155, 115, 56, '<p>The customer cannot upload the site plan after the query. JOB Number is LCGACS65321682023  </p>', '2023-03-31 09:23:16', '2023-03-31 09:23:16', NULL, NULL, NULL, NULL),
(156, 116, 45, '<p>A block allocated on the web app points to a different area on the agent app. Eg: Adenta Division 2 Block 5 on web app does not match same block on the agent app. Attached are 2 images of the same block. One is from the Agent app and the other is from admin portal.</p>', '2023-04-03 10:32:45', '2023-04-03 10:32:45', NULL, NULL, NULL, NULL),
(157, 117, 45, '<p>A block allocated on the web app points to a different area on the agent app. Eg: Adenta Division 2 Block 5 on web app does not match same block on the agent app. Attached are 2 images of the same block. One is from the Agent app and the other is from admin portal.</p>', '2023-04-03 10:38:01', '2023-04-03 10:38:01', NULL, NULL, NULL, NULL),
(158, 118, 45, '<p>After entering the account details, clicking on the Next button does not take you to the next page.</p>', '2023-04-03 10:40:24', '2023-04-03 10:40:24', NULL, NULL, NULL, NULL),
(159, 119, 45, '<p>The MFO account on the admin portal does not have any information on the Reports page. This also affects the report charts on the dashboard. Please find attached the screenshots of the issue.</p>', '2023-04-03 10:43:13', '2023-04-03 10:43:13', NULL, NULL, NULL, NULL),
(160, 120, 45, '<p>The button to revoke cheque payments currently does not work. The dialog box that opens is not complete. Find attached the image</p>', '2023-04-03 10:45:46', '2023-04-03 10:45:46', NULL, NULL, NULL, NULL),
(161, 121, 45, '<p>When a cheque is entered into the admin portal, the payer does not receive a text message confirming payment.</p>', '2023-04-03 10:50:24', '2023-04-03 10:50:24', NULL, NULL, NULL, NULL),
(162, 115, 16, '<p>Can I please have access to the user\'s portal to on the issue is. Thanks</p>', '2023-04-03 11:12:21', '2023-04-03 11:12:21', NULL, NULL, NULL, NULL),
(163, 122, 45, '<p>A map view for the TSO login is needed to aid them to know which blocks they are actually assigning to who. Without this feature, it is impossible to tell which area falls where</p>', '2023-04-03 11:55:31', '2023-04-03 11:55:31', NULL, NULL, NULL, NULL),
(164, 122, 4, '<p>IS this a new feature request?</p>', '2023-04-03 14:57:42', '2023-04-03 14:57:42', NULL, NULL, NULL, NULL),
(165, 123, 56, '<p>The Client paid the following transactions but didn\'t get the receipt and was debited. The plan could not be uploaded. 111199622</p><p>111199611</p><p>111199917</p><p>111199658</p><p>111199646</p><p>email: teidorcas966@gamil.com</p><p>password: 0277356965</p>', '2023-04-04 14:18:55', '2023-04-04 14:18:55', NULL, NULL, NULL, NULL),
(166, 107, 35, '<p>Please may i know how this ticket was resolved</p><p><br></p>', '2023-04-04 16:56:46', '2023-04-04 16:56:46', NULL, NULL, NULL, NULL),
(167, 124, 45, '<p>An account details were entered during registration. The next page (OTP) was opened but an error saying TIN or phone number associated with another account was displayed. The OTP page should not be displayed if the account details already exist in the system. When checking the list of numbers that have been sent an OTP, the number used in registration is also not part.</p><p>Account details:</p><p>Org : MONNICSTAR HOTEL</p><p>TIN: P0000572462</p><p>Contact name. Ebenezer Adu-Gyemfi.</p><p>0256388403</p><p>monnicstar0244@icloud.com</p>', '2023-04-06 09:30:00', '2023-04-06 09:30:00', NULL, NULL, NULL, NULL),
(168, 114, 16, '<p>We are currently looking into that. Will revert once a decision has been made.</p><p><br></p><p>Regards.</p>', '2023-04-14 13:30:18', '2023-04-14 13:30:18', NULL, NULL, NULL, NULL),
(169, 125, 36, '<p>As discussed in last Wednesday\'s (12/04/2023) meeting, please find attached the recommendations that Casantey Business Solutions is to respond to.</p>', '2023-04-14 17:40:35', '2023-04-14 17:40:35', NULL, NULL, NULL, NULL);
INSERT INTO `ticket_replies` (`id`, `ticket_id`, `user_id`, `message`, `created_at`, `updated_at`, `deleted_at`, `imap_message_id`, `imap_message_uid`, `imap_in_reply_to`) VALUES
(170, 126, 36, '<p>The Bank of Ghana under the Borrowers and Lenders Act 2020 has constituted a committee made of representatives from the Bank and the Lands Commission to ensure that the Bank is supported in the implementation and the provisions under Act 1052. The committee is to provide a platform to share ideas leading to possible coordination of activities between the Bank and the Lands Commission. Both the IT Teams from the Bank and the Lands Commission are to discuss modalities for the harmonization of processes between the Bank and the Lands Commission.  In view of the above, Casantey Business Solution is kindly invited to a meeting scheduled for<strong> Wednesday 19th April 2023 at 9 am in the Lands Commission Conference Room. </strong>  Looking forward to seeing you. Regards</p>', '2023-04-17 15:44:42', '2023-04-17 15:44:42', NULL, NULL, NULL, NULL);
